    "`check_for_working_wellknown_setup` is set to false in your configuration, so this check was skipped." : "`check_for_working_wellknown_setup` está definido como falso na túa configuración, polo que se omitiu esta comprobación.",
    "Could not check that your web server serves `.well-known` correctly. Please check manually." : "Non se puido comprobar que o seu servidor web serve `.well-known` correctamente. Compróbeo manualmente.",
    "Your web server is not properly set up to resolve `.well-known` URLs, failed on:\n`%s`" : "O teu servidor web non está configurado correctamente para resolver os URLs `.well-known`, fallou en:\n`%s`",
    "Your server is correctly configured to serve `.well-known` URLs." : "O teu servidor está configurado correctamente para servir URLs `.well-known`.",
    "WOFF2 file loading" : "cargando ficheiro WOFF2",
    "Could not check for WOFF2 loading support. Please check manually if your webserver serves `.woff2` files." : "Non se puido comprobar a compatibilidade de carga de WOFF2. Comprobe manualmente se o seu servidor web serve ficheiros `.woff2`.",
    "Your web server is not properly set up to deliver .woff2 files. This is typically an issue with the Nginx configuration. For Nextcloud 15 it needs an adjustement to also deliver .woff2 files. Compare your Nginx configuration to the recommended configuration in our documentation." : "O teu servidor web non está configurado correctamente para entregar ficheiros .woff2. Normalmente, isto é un problema coa configuración de Nginx. Para Nextcloud 15, necesita un axuste para ofrecer tamén ficheiros .woff2. Compare a configuración de Nginx coa configuración recomendada na nosa documentación.",
    "Profile information" : "Información do perfil",
